        /* 显示的文字样式 */
        .message {
            position: absolute;
            top: 5%;
            font-size: 4em; /* 调小字号 */
            text-align: center;
            width: 100%;
            animation: fadeIn 3s forwards, bounce 2s infinite;
        }

        .message span {
            display: block;
            margin-bottom: 15px;
            background-image: linear-gradient(45deg, #ff416c, #ff4b2b, #ffcc70, #a8e063, #6ac1e8); /* 更鲜艳的渐变色 */
            background-clip: text;
            -webkit-background-clip: text;
            color: transparent;
            font-weight: bold;
            font-family: 'Comic Sans MS', sans-serif;
            letter-spacing: 1px;
        }

        /* 文字动画：淡入 */
        @keyframes fadeIn {
            from { opacity: 0; }
            to { opacity: 1; }
        }

        /* 文字动画：弹跳效果 */
        @keyframes bounce {
            0%, 100% { transform: translateY(0); }
            50% { transform: translateY(-20px); }
        }

        /* 卡片容器的样式 */
        .card {
            width: 300px;
            height: 400px;
            position: absolute;
            top: 50%;
            transform: translateY(-50%);
            display: none; /* 初始时隐藏卡片 */
            cursor: pointer; /* 鼠标悬停显示手指 */
            z-index: 10;
        }

        /* 卡片的正面和背面 */
        .card .front, .card .back {
            width: 100%;
            height: 100%;
            position: absolute;
            top: 0;
            left: 0;
            display: flex;
            justify-content: center;
            align-items: center;
            font-size: 1.5em;
            color: #333;
            text-align: center;
            border-radius: 10px;
            padding: 20px;
            background-size: cover;
            background-position: center;
        }

        /* 正面上的文字内容 */
        .front .card-text {
            font-size: 0.7em;
            color: black;
            text-align: center;
            margin-top: 126%; /* 使文字位于卡片正中 */
            transform: translateY(-50%); /* 确保居中 */
            z-index: 20; /* 确保文字在卡片正面上方 */
        }

        /* 烟花动画 */
        .fireworks {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            pointer-events: none;
            z-index: 20;
        }

        /* 烟花点 */
        .firework {
            position: absolute;
            border-radius: 50%;
            opacity: 0;
            animation: fireworkAnim 2s forwards; /* 增加烟花的飞行时间 */
        }

        /* 烟花动画：从下到中爆炸 */
        @keyframes fireworkAnim {
            0% {
                opacity: 1;
                transform: scale(1) translateY(100%);
            }
            50% {
                transform: scale(2) translateY(-40%);
            }
            100% {
                opacity: 0;
                transform: scale(5) translateY(-200%); /* 增加飞行距离 */
            }
        }
    </style>
</head>
<body>
    <!-- 显示浮动的文字 -->
    <div class="message">
        <span>Happy Birthday!</span>
        <span>欢迎来到 鱼隽盐 的生日派对！</span>
    </div>

    <!-- 卡片容器 -->
    <div class="card" id="card">
        <div class="front">
            <!-- 正面背景图片 -->
            <div class="card-text" id="card-text">
                获得道具：简陋弹弓！<br>
                听说用它来射击天上的气球会有特别的事情发生呢 ---西施惠
            </div>
        </div>
        <div class="back">
            <!-- 背面背景图片 -->
        </div>
    </div>

    <!-- 烟花效果 -->
    <div class="fireworks" id="fireworks"></div>

    <script>
        let card = document.getElementById("card");
        let front = card.querySelector(".front");
        let back = card.querySelector(".back");
        let cardText = document.getElementById("card-text");
        let fireworksContainer = document.getElementById("fireworks");

        // 页面点击事件：显示卡片并翻转
        document.body.addEventListener("click", function() {
            // 显示卡片
            if (card.style.display === 'none') {
                card.style.display = 'block'; // 显示卡片
            } else {
                // 点击后正面覆盖在背面上
                back.style.display = 'none'; // 隐藏背面
                front.style.display = 'block'; // 显示正面

                // 显示卡片下方文字
                cardText.style.display = 'block';

                // 添加烟花效果
                triggerFireworks();
            }
        });

        // 页面加载时，初始时隐藏卡片
        window.onload = function() {
            card.style.display = 'none'; // 隐藏卡片
            cardText.style.display = 'none'; // 隐藏卡片下方文字
        };

        // 烟花效果函数
        function triggerFireworks() {
            for (let i = 0; i < 10; i++) {
                let firework = document.createElement("div");
                firework.classList.add("firework");
                firework.style.backgroundColor = `hsl(${Math.random() * 360}, 100%, 75%)`; // 随机颜色
                firework.style.width = `${Math.random() * 20 + 10}px`; // 随机大小
                firework.style.height = firework.style.width;
                firework.style.left = `${Math.random() * window.innerWidth}px`;
                firework.style.top = `${window.innerHeight - Math.random() * 100}px`; // 从下方发射

                fireworksContainer.appendChild(firework);

                // 删除烟花点
                setTimeout(() => {
                    firework.remove();
                }, 2000); // 烟花消失时间
            }
        }
    </script>
</body>
</html>
